SELECT * FROM cyber_id ci WHERE cyber_id ~'CYR01-23-0511' ORDER BY id;

SELECT * FROM step_record sr WHERE cyber_id ~'CYR01-23-0511' AND id IN (16593, 13322, 16913) ORDER BY id; 

SELECT KEY, string_value FROM step_record_fields srf WHERE step_record_id=(SELECT id FROM step_record sr WHERE cyber_id='CYR01-23-0605-275904' ORDER BY id DESC LIMIT 1);


SELECT LEFT(cyber_id,20) FROM step_record sr WHERE id IN (SELECT step_record_id FROM step_record_fields srf WHERE string_value='false' AND KEY='Only_One_Producction') ORDER BY cyber_id;


SELECT * FROM v_register_log_with_actions vrlwa ORDER BY "timestamp" desc;

SELECT * FROM v_register_log_detail WHERE cyber_id ='CYR01-24-0004-294278'
SELECT DISTINCT LEFT(cyber_id_group,20) FROM group_movement gm WHERE order_id <> '00' ORDER BY LEFT(cyber_id_group,20);


SELECT * FROM v_register_log_with_actions_groups vrlwag ORDER BY cyber_id, "timestamp" DESC;

WITH fsteps AS (SELECT rank() OVER (PARTITION BY cyber_id ORDER BY id DESC) AS rrank, * FROM register_log rl WHERE step=1 )
SELECT id, * FROM fsteps WHERE rrank=1 AND success=TRUE AND cyber_id~'23-0511';





SELECT DISTINCT id, LEFT(sr.cyber_id,20), sr.cyber_id, rank() OVER (PARTITION BY LEFT(sr.cyber_id,20) ORDER BY id DESC) AS rrank
           FROM step_record sr
          WHERE (sr.id IN ( SELECT srf.step_record_id
                  			  FROM step_record_fields srf
               				 WHERE srf.string_value = 'false'::text AND srf.key::text = 'Only_One_Producction'::text)
               	) 
 ORDER BY LEFT(sr.cyber_id,20), rrank DESC 
               				 
SELECT * FROM step_record sr WHERE left(cyber_id,20)~'CYR01-23-0605-275904'

SELECT * FROM cyber_id ci               				 
               				 
               				 

SELECT sr.cyber_id, sr."timestamp" , sr.role_name, KEY, date_value, string_value
  FROM step_record_fields srf
       INNER JOIN step_record sr ON sr.id=srf.step_record_id 
 WHERE cyber_id ~'CYR01-24-0036-302429' AND KEY ~*'ref'
ORDER BY LEFT(sr.cyber_id,20), sr.id DESC 

SELECT * FROM product_search_index psi WHERE cyber_id ~'CYR01-24-0036-302429';


